pragma solidity 0.5.7;

interface VerifiedClient{

    function setCustody(address _client, bytes32 _account) external;

    function getCustody(address _client) external view returns(bytes32);

    function setAccess(string calldata messagingToken) external;

    function getAccess(address _client) external view returns(string memory);

    function setManager(address _client, address _manager) external;

    function getManager(address _client) external view returns(address);

    function isRegistered(address _client) external view returns(bool);

    function setAMLStatus(address _client, bool status) external;

    function getAMLStatus(address _client) external view returns(bool);

    function getClients(address _manager) external view returns(address[] memory);

    function addRole(address _submanager, bytes32 _country, bytes32 _role, bytes32 _id) external;

    function getRole(address _user) external view returns(bytes32, bytes32);

    function removeRole(address _submanager, bytes32 _country, bytes32 _role) external;

    function getManagers(bytes32 _role, bytes32 _country) external view returns(address[] memory);

    function getAMLManager() external view returns(address);

    function isManagerOf(address _submanager) external view returns(address);

}
